    return (
        <header className="header">
            <img
                src={logo}
                alt="Логотип сайта Место"
                className="header__logo"
            />
            <div className="header__information">
                <Link to="/signup" className="header__link">
                    Регистрация
                </Link>
            </div>
            <div className="header__information">
                <Link to="/signup" className="header__link">
                    Регистрация
                </Link>
            </div>
        </header>
    );
}
